                menu={renderSupervisores()}
                />
            </div>
            <div className="div-id">
                <a>{'Identificador: '+random}</a>
                </div>
            
        </div>
    </div>);}


  


    return (
        <div className="App-Crear-Colaborador">
            
            <a>Lista de colaboradores en el sistema üë®‚Äçüíº</a>
            {cardColaborador()}
            
        </div>
    );
}
